import React from "react";
import Carousel from "react-bootstrap/Carousel";
import Back from "./back.png"
// import axios from "axios";
import "./card.css";

const Car = (props) => {
return (
  <div> <h4>Place Card Here</h4>
  <Carousel>
    <Carousel.Item>
      <img
        className="cardBack"
        src="holder.js/800x400?text=First slide&bg=373940"
        alt="Card Back"
      />
    </Carousel.Item>
    <Carousel.Item>
      <img
        className="cardFront"
        src="holder.js/800x400?text=Second slide&bg=282c34"
        alt="Card Front"
      />
    </Carousel.Item>
  </Carousel>
  </div>
)
  
}

export default Car;
